import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Robot } from './Robot'
import reportWebVitals from './reportWebVitals';
import Card from './Card';
import 'tachyons';

ReactDOM.render(
  <React.StrictMode>
    <div>
    <Card id = {Robot[0]} name ={Robot[0].name} email={Robot[0].email}/>
    <Card  id = {Robot[1]} name ={Robot[1].name} email={Robot[1].email}/>
    <Card id = {Robot[2]} name ={Robot[2].name} email={Robot[2].email}/>
    <Card id = {Robot[3]} name ={Robot[3].name} email={Robot[3].email}/>
    </div>

  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
